CREATE TABLE `barang_permintaan` (
  `idbarang` int(11) NOT NULL AUTO_INCREMENT,
  `idpermintaan` int(11) DEFAULT NULL,
  `namabarang` varchar(255) DEFAULT NULL,
  `unit` varchar(50) DEFAULT NULL,
  `qtypermintaan` int(11) DEFAULT NULL,
  `keterangan` varchar(255) DEFAULT NULL,
  `bukti_base64` text DEFAULT NULL,
  `status_barang` int(11) DEFAULT NULL,
  PRIMARY KEY (`idbarang`),
  KEY `barang_permintaan_ibfk_1` (`idpermintaan`),
  CONSTRAINT `barang_permintaan_ibfk_1` FOREIGN KEY (`idpermintaan`) REFERENCES `permintaan` (`idpermintaan`),
  CONSTRAINT `fk_idpermintaan` FOREIGN KEY (`idpermintaan`) REFERENCES `permintaan` (`idpermintaan`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;


CREATE TABLE `keluar` (
  `idkeluar` int(11) NOT NULL AUTO_INCREMENT,
  `idpermintaan` int(11) NOT NULL,
  `idbarang` int(11) NOT NULL,
  `qty` int(11) DEFAULT NULL,
  `keterangan` text DEFAULT NULL,
  `penerima` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`idkeluar`),
  KEY `fk_permintaan` (`idpermintaan`),
  CONSTRAINT `fk_permintaan` FOREIGN KEY (`idpermintaan`) REFERENCES `permintaan_keluar` (`idpermintaan`),
  CONSTRAINT `keluar_ibfk_1` FOREIGN KEY (`idpermintaan`) REFERENCES `permintaan_keluar` (`idpermintaan`)
) ENGINE=InnoDB AUTO_INCREMENT=124 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;


CREATE TABLE `log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `activity` varchar(255) DEFAULT NULL,
  `timestamp` datetime DEFAULT current_timestamp(),
  `iduser` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_iduser` (`iduser`),
  CONSTRAINT `fk_iduser` FOREIGN KEY (`iduser`) REFERENCES `login` (`iduser`)
) ENGINE=InnoDB AUTO_INCREMENT=1048 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;


CREATE TABLE `login` (
  `iduser` int(11) NOT NULL AUTO_INCREMENT,
  `email` varchar(50) NOT NULL,
  `password` varchar(50) NOT NULL,
  `role` varchar(10) NOT NULL,
  PRIMARY KEY (`iduser`)
) ENGINE=InnoDB AUTO_INCREMENT=52 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;


CREATE TABLE `masuk` (
  `idmasuk` int(11) NOT NULL AUTO_INCREMENT,
  `idbarang` int(11) NOT NULL,
  `tanggal` timestamp NOT NULL DEFAULT current_timestamp(),
  `keterangan` varchar(50) NOT NULL,
  `qty` int(11) NOT NULL,
  `penerima` varchar(50) NOT NULL,
  `bukti_masuk_base64` text NOT NULL,
  `distributor` varchar(100) NOT NULL,
  `deskripsi` varchar(50) NOT NULL,
  `status` int(3) NOT NULL,
  PRIMARY KEY (`idmasuk`)
) ENGINE=InnoDB AUTO_INCREMENT=175 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;


CREATE TABLE `permintaan` (
  `idpermintaan` int(11) NOT NULL AUTO_INCREMENT,
  `tanggal` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `bukti_base64` text NOT NULL,
  `status` int(3) NOT NULL,
  PRIMARY KEY (`idpermintaan`)
) ENGINE=InnoDB AUTO_INCREMENT=159 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;


CREATE TABLE `permintaan_keluar` (
  `idpermintaan` int(11) NOT NULL AUTO_INCREMENT,
  `tanggal` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `gambar_base64` text NOT NULL,
  PRIMARY KEY (`idpermintaan`)
) ENGINE=InnoDB AUTO_INCREMENT=61 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;


CREATE TABLE `retur` (
  `no` int(11) NOT NULL AUTO_INCREMENT,
  `tanggal` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `idretur` int(11) NOT NULL,
  `idbarang` int(11) NOT NULL,
  `unit` varchar(50) NOT NULL,
  `qtyretur` varchar(50) NOT NULL,
  `keterangan` varchar(50) NOT NULL,
  `gambar_base64` text NOT NULL,
  PRIMARY KEY (`no`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;


CREATE TABLE `stock` (
  `idbarang` int(11) NOT NULL AUTO_INCREMENT,
  `namabarang` varchar(25) NOT NULL,
  `deskripsi` varchar(50) NOT NULL,
  `stock` int(11) NOT NULL,
  `lokasi` varchar(100) NOT NULL,
  `unit` varchar(50) NOT NULL,
  PRIMARY KEY (`idbarang`)
) ENGINE=InnoDB AUTO_INCREMENT=186 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;


